var audioQuque = new Array();

function nextFrame() {
	if (playing == true && paused == false) {
		audioQuque = new Array();
		if (playingVoice) {
			playingVoice.pause();
			playingVoice.currentTime = 0;
			playingVoice = null;
			playingAudio = false;
		}
		if (frameIndex < playTo) {
			frameIndex++;
		} else if (frameIndex > playTo) {
			frameIndex--;
		} else {
			if (frameIndex == 0 || frameIndex == frameCount - 1) {
				playing = false;
				paused = false;
				stopEvent();
			} else {
				if (!playingAudio) {
		animateV();
				}
				paused = true;
				pauseEvent();
			}
		}
	}
}
function nextAudio() {
	if (audioQuque.length > 0) {
		var voice = audioQuque.shift();
		playingVoice = voice;
		voice.play();
		voice.setAttribute("onended", "nextAudio()");
	} else {
		playingVoice = null;
		playingAudio = false;
	}
}

function updateControls() {
	var previous = document.getElementById("previous");
	var pause = document.getElementById("pause");
	var play = document.getElementById("play");
	var next = document.getElementById("next");
	var stop = document.getElementById("stop");
	if (playing == true && paused == false) {
		pause.style.display = "inline";
		play.style.display = "none";
	} else {
		pause.style.display = "none";
		play.style.display = "inline";
		if (loading == true) {
			if (play.src.indexOf("img/NewPlay.png") >= 0) {
				play.src = "img/NewPlayDisabled.png";
			}
		} else {
			if (play.src.indexOf("img/NewPlayDisabled.png") >= 0) {
				play.src = "img/NewPlay.png";
			}
		}
	}
	if (previousIndex < frameIndex) {
		if (previous.src.indexOf("img/NewPreviousDisabled.png") >= 0) {
			previous.src = "img/NewPrevious.png";
		}
	} else {
		previous.src = "img/NewPreviousDisabled.png";
	}
	if (nextIndex > frameIndex) {
		if (next.src.indexOf("img/NewNextDisabled.png") >= 0) {
			next.src = "img/NewNext.png";
		}
	} else {
		next.src = "img/NewNextDisabled.png";
	}
	if (playing == true || paused == true) {
		if (stop.src.indexOf("img/NewStopDisabled.png") >= 0) {
			stop.src = "img/NewStop.png";
		}
	} else {
		if (frameIndex == 0) {
			if (stop.src.indexOf("img/NewStop.png") >= 0) {
				stop.src = "img/NewStopDisabled.png";
			}

document.onkeydown = documentKeyDown;
function documentKeyDown(e) {
	if (loading == true) {
		return;
	}
	if (e.ctrlKey == true) {
		if (e.keyCode == 80 || e.keyCode == 112) { // P
			if (e.preventDefault) {
				e.preventDefault();
			}
			if (playing == true && paused == false) {
		animateV();
				paused = true;
				pauseEvent();
			} else {
				audioQuque = new Array();
				if (playingVoice) {
					playingVoice.pause();
					playingVoice.currentTime = 0;
					playingVoice = null;
					playingAudio = false;
				}
				playTo = frameCount - 1;
				if (paused == true) {
					paused = false;
				} else {
					playing = true;
					paused = false;
					frameIndex = 0;
					layerOffsetX = 0;
					layerOffsetY = 0;
				}
				playEvent();
			}
		} else if (e.keyCode == 37) { // Left
			playTo = previousIndex;
			playing = true;
			paused = false;
			previousEvent();
		} else if (e.keyCode == 39) { // Right
			playTo = nextIndex;
			playing = true;
			paused = false;
			nextEvent();
		} else if (e.keyCode == 32) { // Space
			audioQuque = new Array();
			if (playingVoice) {
				playingVoice.pause();
				playingVoice.currentTime = 0;
				playingVoice = null;
				playingAudio = false;
			}
			playing = false;
			paused = false;
			frameIndex = 0;
			layerOffsetX = 0;
			layerOffsetY = 0;
			playEvent();
		}
	}
}
document.onmousemove = documentMouseMove;
document.onmousedown = documentMouseDown;
document.onmouseup = documentMouseUp;
var mouseX = 0;
var mouseY = 0;
function documentMouseMove(e) {
	if (IE) {
		mouseX = event.clientX + document.body.scrollLeft;
		mouseY = event.clientY + document.body.scrollTop;
	} else {
		mouseX = e.pageX;
		mouseY = e.pageY;
	}  
	if (mouseX < 0) {
		mouseX = 0;
	}
	if (mouseY < 0) {
		mouseY = 0;
	}
	performDragLayer();
	performDragProgress();
}
function documentMouseDown(e) {
	if (loading == true) {
		return;
	}
	{ // Layer
		var lMinX = 0;
		var lMaxX = viewportWidth;
		var lMinY = 0;
		var lMaxY = viewportHeight - 34;
		if (mouseX >= lMinX && mouseY >= lMinY && mouseX <= lMaxX && mouseY <= lMaxY) {
			if (e.preventDefault) {
				e.preventDefault();
			}
			startDragLayer();
		}
	}
	{ // Progress
		var lMinX = 177;
		var lMaxX = viewportWidth - 25;
		var lMinY = viewportHeight - 25;
		var lMaxY = lMinY + 15;
		if (mouseX >= lMinX && mouseY >= lMinY && mouseX <= lMaxX && mouseY <= lMaxY) {
			if (e.preventDefault) {
				e.preventDefault();
			}
			startDragProgress();
		}
	}
}
function documentMouseUp(e) {
	if (loading == true) {
		return;
	}
	documentMouseMove(e);
	endDragLayer();
	endDragProgress();
}
var layerTranslateX = 0;
var layerTranslateY = 0;
var layerOffsetY = 0;
var layerOffsetX = 0;
var layerOffsetY = 0;
var draggingLayer = false;
var layerOffsetTempX = 0;
var layerOffsetTempY = 0;
var layerPressX = 0;
var layerPressY = 0;
var lastScroll = new P(661, 186);
function startDragLayer() {
	if (draggingLayer == false) {
		layerPressX = mouseX
		layerPressY = mouseY
		layerOffsetTempX = layerOffsetX
		layerOffsetTempY = layerOffsetY
		draggingLayer = true;
	}
}
function endDragLayer() {
	if (draggingLayer) {
		draggingLayer = false;
	}
}
function performDragLayer() {
	if (draggingLayer) {
		layerOffsetX = layerOffsetTempX + mouseX - layerPressX;
		layerOffsetY = layerOffsetTempY + mouseY - layerPressY;
	}
}
var draggingProgress = false;
function startDragProgress() {
	if (draggingProgress == false) {
		draggingProgress = true;
		audioQuque = new Array();
		if (playingVoice) {
			playingVoice.pause();
			playingVoice.currentTime = 0;
			playingVoice = null;
			playingAudio = false;
		}
	}
}
function endDragProgress() {
	if (draggingProgress) {
		draggingProgress = false;
	}
}
function performDragProgress() {
	if (draggingProgress) {
		audioQuque = new Array();
		if (playingVoice) {
			playingVoice.pause();
			playingVoice.currentTime = 0;
			playingVoice = null;
			playingAudio = false;
		}
		var lMinX = 177;
		var lMaxX = viewportWidth - 25;
		var lX = mouseX;
		lX = Math.max(lX , lMinX);
		lX = Math.min(lX , lMaxX);
		var lPercent = (lX - lMinX) / (lMaxX - lMinX);
		playing = false;
		paused = false;
		frameIndex = Math.round((frameCount - 1) * lPercent);
	}
}
function performMousePressed(id, path, pressedPath, disablePath) {
	if (loading == true) {
		return;
	}
	var image = document.getElementById(id);
	if (image.src.indexOf(disablePath) < 0) {
		image.src = pressedPath;
	}
}
function performMouseUp(id, path, pressedPath, disablePath) {
	if (loading == true) {
		return;
	}
	var image = document.getElementById(id);
	if (image.src.indexOf(pressedPath) >= 0) {
		image.src = path;
		if ("previous" == id) {
			playTo = previousIndex;
			playing = true;
			paused = false;
			previousEvent();
		} else if ("pause" == id) {
		animateV();
			paused = true;
			pauseEvent();
		} else if ("play" == id) {
			audioQuque = new Array();
			if (playingVoice) {
				playingVoice.pause();
				playingVoice.currentTime = 0;
				playingVoice = null;
				playingAudio = false;
			}
			playTo = frameCount - 1;
			if (paused == true) {
				paused = false;
			} else {
				playing = true;
				paused = false;
				frameIndex = 0;
				layerOffsetX = 0;
				layerOffsetY = 0;
			}
			playEvent();
		} else if ("next" == id) {
			playTo = nextIndex;
			playing = true;
			paused = false;
			nextEvent();
		} else if ("stop" == id) {
			audioQuque = new Array();
			if (playingVoice) {
				playingVoice.pause();
				playingVoice.currentTime = 0;
				playingVoice = null;
				playingAudio = false;
			}
			playing = false;
			paused = false;
			frameIndex = 0;
			layerOffsetX = 0;
			layerOffsetY = 0;
			stopEvent();
		}
	}
}
function performMouseOut(id, path, pressedPath, disablePath) {
	if (loading == true) {
		return;
	}
	var image = document.getElementById(id);
	if (image.src.indexOf(pressedPath) >= 0) {
		image.src = path;
	}
}
function animate() {
	// detect viewport size
	if (typeof window.innerWidth != 'undefined') {
		viewportWidth = window.innerWidth,
		viewportHeight = window.innerHeight
	} else if (typeof document.documentElement != 'undefined' && typeof document.documentElement.clientWidth != 'undefined' && document.documentElement.clientWidth != 0) {
		viewportWidth = document.documentElement.clientWidth,
		viewportHeight = document.documentElement.clientHeight
	} else {
		viewportWidth = document.getElementsByTagName('body')[0].clientWidth,
		viewportHeight = document.getElementsByTagName('body')[0].clientHeight
	}
	var canvas = document.getElementById("canvas");
	var context = canvas.getContext("2d");
	// context.clearRect(0, 0, canvas.width, canvas.height);
		animateS();
	layout();
	updateControls();
	if (loading == true) {
		var layerContainer = document.getElementById("layerContainer");
		layerContainer.style.left = "0px";
		layerContainer.style.top = "0px";
		canvas.width = viewportWidth;
		canvas.height = viewportHeight;
		var loadingText = "Loading... " + imageLoadingText + " " + audioLoadingText;
		var textMetrics = context.measureText(loadingText);
		context.fillText(loadingText, (viewportWidth - textMetrics.width) / 2, (viewportHeight - 34) / 2);
	} else {
		var viewBoundsX = (layerTranslateX - layerOffsetX);
		var viewBoundsY = (layerTranslateY - layerOffsetY);
		var viewBoundsX2 = viewBoundsX + viewportWidth;
		var viewBoundsY2 = viewBoundsY + viewportHeight - 34;
		var lBgX = 0;
		var lBgY = 0;
		for (var lRow = 0; lRow < 2; lRow++) {
			lBgX = 0;
			var lBgWidth;
			var lBgHeight;
			if (lRow == 1) {
				lBgHeight = 1486 - lBgY;
			} else {
				lBgHeight = 1000;
			}
			for (var lColumn = 0; lColumn < 2; lColumn++) {
				if (lColumn == 1) {
					lBgWidth = 1512 - lBgX;
				} else {
					lBgWidth = 1000;
				}
				var lBgTempMinX = Math.min(viewBoundsX, lBgX);
				var lBgTempMaxX = Math.min(viewBoundsX2, lBgX + lBgWidth);
				var lBgTempMinY = Math.min(viewBoundsY, lBgY);
				var lBgTempMaxY = Math.min(viewBoundsY2, lBgY + lBgHeight);
				var lXOverlap = (lBgTempMaxX - lBgTempMinX) < (lBgWidth + viewportWidth);
				var lYOverlap = (lBgTempMaxY - lBgTempMinY) < (lBgHeight + viewportHeight);
				if (lXOverlap && lYOverlap) {
					try {
						var lBgId = "BG_" + lRow + "_" + lColumn;
						context.drawImage(eval(lBgId), lBgX, lBgY, lBgWidth, lBgHeight);
					} catch (e) {}
				}
				lBgX += 1000;
			}
			lBgY += 1000;
		}
		animateF1();
		animateF2();
		animateF3();
		animateF4();
		animateF5();
		animateL1();
		animateL2();
		animateL3();
		animateL4();
		animateL5();
		animateB();
		animateD();
		animatePI();
		animateNI();
	}
	window.refreshAnimationLayer(function() {
		animate();
	});
}

	var radius = 5;
	var balls = B[frameIndex];

		context.arc(ball.x, ball.y, radius, 0, 2 * Math.PI, false);
		context.fill();
	}
}

function animateL1() {
	var canvas = document.getElementById("canvas");
	var context = canvas.getContext("2d");
	context.strokeStyle = "rgba(189, 64, 255, 1.0)";
	context.lineWidth = 3;
	var areas = L1[frameIndex];
	for(var i = 0; i < areas.length; i++) {
		var area = areas[i];
		context.beginPath();
		for(var j = 0; j < area.length; j++) {
			var areaPoint = area[j];
			if (areaPoint.type == 0) {
				context.moveTo(areaPoint.x, areaPoint.y);
			} else if (areaPoint.type == 1) {
				context.lineTo(areaPoint.x, areaPoint.y);
			} else if (areaPoint.type == 4) {
				context.closePath();
			}
		}
		context.stroke();
	}
}

var ImageLoader = function () {
	this.onprogress = function (loaded, total) {};
	this.oncompletion = function (images) {};
	this.loaded = this.total = 0;
	this.load = function (images) {
		var loader = this;
		for (i in images) {
			if (typeof images[i] != "string") {
				continue;
			}
			try {
				this.total++;
				var imageSrc = images[i];
				images[i] = new Image();
				images[i].src = imageSrc;
				images[i].onload = function () {
					loader.loaded++;
					loader.onprogress(loader.loaded, loader.total);
					if (loader.loaded == loader.total) {
						loader.oncompletion(images);
					}
				}
			} catch (e) {}
		}
		loader.onprogress(this.loaded, this.total);
		if (this.total == 0) {
			loader.oncompletion(images);
		}
	}
}
var loadingImage = true;
loadImages = function() {
	this.loader = new ImageLoader();
	this.loader.onprogress = function (loaded, total) {
		imageLoadingText = "Image " + loaded + "/" + total;
	}
	this.loader.oncompletion = function (images) {
		imageLoadingText = "";
		loadingImage = false;
		if (loadingImage == false && loadingAudio == false) {
			loading = false;
		}
	}
	this.loader.load({
		previous: "img/NewPrevious.png",
		pausePressed: "img/NewPausePressed.png",
		BG_0_1: "img/BG_0_1.png",
		pauseDisable: "img/NewPauseDisabled.png",

		pause: "img/NewPause.png",

		nextDisable: "img/NewNextDisabled.png",
		BG_1_1: "img/BG_1_1.png",
		BG_1_0: "img/BG_1_0.png",
		previousPressed: "img/NewPreviousPressed.png",
		play: "img/NewPlay.png",
		previousDisable: "img/NewPreviousDisabled.png",
		playPressed: "img/NewPlayPressed.png",
		stopPressed: "img/NewStopPressed.png",
		playDisable: "img/NewPlayDisabled.png",
		stopDisable: "img/NewStopDisabled.png",
	});
}
var AudioLoader = function () {
	this.onprogress = function (loaded, total) {};
	this.oncompletion = function (audios) {};
	this.loadedSrc = new Array();
	this.loaded = this.total = 0;
	this.load = function (audios) {
		var loader = this;
		for (i in audios) {
			if (typeof audios[i] != "string") {
				continue;
			}
			try {
				this.total++;
				var audioSrc = audios[i];
				this.loadedSrc[audioSrc] = false;
				audios[i] = new Audio();
				audios[i].addEventListener('canplaythrough', function() {
					loader.loadedSrc[this.src] = true;
					loader.loaded = 0;
					for (curSrc in loader.loadedSrc) {
						if (loader.loadedSrc[curSrc] == true) {
							loader.loaded++;
						}
					}
					loader.onprogress(loader.loaded, loader.total);
					if (loader.loaded == loader.total) {
						loader.oncompletion(audios);
					}
				}, false);
				audios[i].src = audioSrc;
			} catch (e) {}
		}
		loader.onprogress(this.loaded, this.total);
		if (this.total == 0) {
			loader.oncompletion(audios);
		}
	}
}
var loadingAudio = true;
loadAudios = function() {
	this.loader = new AudioLoader();
	this.loader.onprogress = function (loaded, total) {
		audioLoadingText = "Audio " + loaded + "/" + total;

		audioLoadingText = "";
		loadingAudio = false;
		if (loadingImage == false && loadingAudio == false) {

		}

	});
